import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import Form from "react-bootstrap/Form";

function App() {
  return (
    <div className='App'>
      <Container fluid>
        <Row>
          <Col>
            <h1>React Dictionary</h1>
          </Col>
          <Col>
            <Form.Check
              type='switch'
              id='custom-switch'
              label='Check this switch'
            />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
